import './Home.css';
import Button from '@mui/material/Button';
import {useNavigate} from 'react-router-dom';
import SearchIcon from '@mui/icons-material/Search';
import CompareArrowsIcon from '@mui/icons-material/CompareArrows';
import { Context } from '../../controller/info';
import { useContext } from 'react';

export default function Home() {
  const user = useContext(Context)
  const navigate = useNavigate()
  return (
    <>
      <h1>Welcome to Best-Fit Colleges.</h1> 
      <p>Let us find the best colleges for you.</p>
      <div className = "buttons">
        <Button variant="contained" sx ={{fontWeight: 700, fontSize : 13}} onClick={() => {
          window.localStorage.setItem("data",JSON.stringify([]))
          user.updateData([])
          navigate('Tab1')
        }}>
          Search Colleges
          <SearchIcon sx={{ marginLeft: '5px' }}></SearchIcon>
        </Button>
        <Button variant="contained" sx ={{fontWeight: 700, fontSize : 13}} onClick={() => {
          window.localStorage.setItem("data",JSON.stringify([]))
          user.updateData([])
          navigate('Tab3')
        }}>
          Compare Colleges
          <CompareArrowsIcon sx={{ marginLeft: '5px' }}></CompareArrowsIcon>
        </Button>
      </div>
    </>
  );
}
